import React from 'react'
import styled from 'styled-components'
// @ts-ignore
import imprint from 'imprintjs'

import Title from '../src/components/atoms/title'
const Main = styled.main`
  background: #282A36;
  height: 100vh;
  width: 100%;
  margin: 0;
  padding: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`





var browserTests = [
  "audio",
  "availableScreenResolution",
  "canvas",
  "colorDepth",
  "cookies",
  "cpuClass",
  "deviceDpi",
  "doNotTrack",
  "indexedDb",
  "installedFonts",
  //"installedLanguages",
  "language",
  "localIp",
  "localStorage",
  "pixelRatio",
  "platform",
  "plugins",
  "processorCores",
  "screenResolution",
  "sessionStorage",
  "timezoneOffset",
  "touchSupport",
  "userAgent",
  "webGl"
];

var deviceTests = [
  "audio",
  "colorDepth",
  "cpuClass",
  "deviceDpi",
  "localIp",
  "platform",
  "installedFonts",
  "processorCores",
  "publicIp",
  "screenResolution",
  "timezoneOffset"
];

console.time('getImprint 1');
imprint.test(browserTests).then(function(result: string){
  console.timeEnd(result);
});


export default () => {

  return (
    <Main>
      <Title fingerPrint="asd"/>
    </Main>
  )
}
